th': paths_uka,\n                           'TopoFeature': np.ones(len(paths_uka))})\n    df = pd.concat([df_tka, df_uka], axis=0)\n    df['TopoFeature'] = df['TopoFeature'].astype(object)\n\n    @dask.delayed\n    def run_extraction(path):\n        mask = load_meta_img(path)\n        pc = mask_to_boundary_pts(mask)\n        x = tda_feat_extract(pc, repre_model_params)\n        return x\n\n    delayed_tda_list = []\n    for path in df.Path:\n        delayed_tda_list.append(\n                                run_extraction(path)\n                                    )\n\n    with performance_report(filename=\"dask-report.html\"):\n        res = dask.delayed()(delayed_tda_list)\n        pbar = ProgressBar() # register global progressbar\n        pbar.register()\n        tda_feat_list = res.compute()\n\n    df['TopoFeature'] = tda_feat_list\n    df.to_csv('TDA_features.csv')\n    \n    return df\n\n        &lt;/pre&gt;\n        "},"id":"3322","type":"Div"},{"attributes":{"coordinates":null,"group":null},"id":"3336","type":"Title"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"3055","type":"Quad"},{"attributes":{},"id":"3374","type":"CategoricalTickFormatter"},{"attributes":{"coordinates":null,"formatter":{"id":"3349"},"group":null,"major_label_policy":{"id":"3350"},"ticker":{"id":"2969"},"visible":false},"id":"2968","type":"LinearAxis"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"bandwidth","transform":{"id":"3103"}},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"bandwidth","transform":{"id":"3103"}},"height":{"value":1},"line_alpha":{"value":0.2},"line_color":{"field":"bandwidth","transform":{"id":"3103"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"3125","type":"Rect"},{"attributes":{},"id":"3375","type":"AllLabels"},{"attributes":{},"id":"3376","ty
